import * as React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Modal from '@mui/material/Modal';
import { ThemeProvider, createTheme } from '@mui/system';

const theme = createTheme({
  palette: {
    background: {
      paper: '#fff',
    },
    text: {
      primary: '#173A5E',
      secondary: '#46505A',
    },
    action: {
      active: '#001E3C',
    },
    success: {
      dark: '#009688',
    },
  },
});

// const style = {
//   position: 'absolute',
//   top: '50%',
//   left: '50%',
//   transform: 'translate(-50%, -50%)',
//   width: 400,
//   bgcolor: 'background.paper',
//   border: '5px solid #94ECF5',
//   boxShadow: 24,
//   p: 4,
// };



export default function DataModal({selectedData}) {
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  console.log("selectedData: ", selectedData)

  return (
    <div>
      <Button onClick={handleOpen}>Details</Button>
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={theme}>
          <Typography id="modal-modal-title" variant="h6" component="h2">Detailed Data</Typography>
          <Typography id="modal-modal-description" sx={{ bgcolor: 'background.paper', boxShadow: 1, borderRadius: 2, p: 2,minWidth: 300, }}
                                                    
                >

            <div>
                ID: {selectedData.id},
                Name: {selectedData.name},
                User Name: {selectedData.username},
                Email: {selectedData.email},
                Phone: {selectedData.phone}, 
                Website: {selectedData.website}
            </div>
                
            </Typography>
        </Box>
      </Modal>
    </div>
  );
}
